sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var pattern1 = /^[0-9]{3}-[0-9]{4}$/;
  var pattern2 = /^[0-9]{7}$/;

  if (pattern1.test(inputs.strZipCode)|pattern2.test(inputs.strZipCode)) {
    gs.info('Valid Zip Code is inputted')
  }else{
      throw 'Invalid Zip Code is inputted!'
  }
})(inputs, outputs);

